  left: 50%;
  transform: translateX(-50%);
  background: linear-gradient(90deg, #f2f2f2, #fff, #f2f2f2);
  box-shadow: 0 0 0.1rem rgba(0,0,0,0.05) inset;
  width: 20%;
  height: 0.3rem;
  -webkit-border-radius: 0.125rem;
  -moz-border-radius: 0.125rem;
