#reward-btn {
  position: relative;
  display: inline-block;
  height: 36px;
  line-height: 36px;
  margin: 60px 0;
  padding: 0 20px;
  font-size: 18px;
  color: #fff;
  background: #403e3e;
  text-decoration: none;
  -webkit-border-radius: 4px;
  -moz-border-radius: 4px;
  border-radius: 4px;
  margin-left: 50%;
  transform: translateX(-50%);
  box-shadow: 0 2px 5px 0 rgba(0,0,0,0.16), 0 2px 10px 0 rgba(0,0,0,0.12);
  -webkit-transition: 0.4s ease-in-out;
  transition: 0.4s;
  cursor: pointer;
}
#reward-btn:hover,
#reward-btn:active {
  box-shadow: 0 6px 12px rgba(0,0,0,0.2), 0 4px 15px rgba(0,0,0,0.2);
}
#reward {
  position: absolute;
  z-index: 9999;
  left: 50%;
  top: 20%;
  transform: translateX(-50%);
  margin: 60px 0;
  padding: 0px 20px 20px;
  background-color: #dbedff;
  display: none;
}
#reward.ready {
  visibility: hidden;
  display: block;
  transform: translate(-50%, -100%);
  transition: 0.3s;
}
#reward.in {
  visibility: visible;
  opacity: 1;
  transform: translate(-50%, 0);
}
#reward .close {
  height: 28px;
  line-height: 28px;
  width: 28px;
  display: block;
  text-align: center;
  position: absolute;
  right: -12px;
  top: -10px;
  -webkit-border-radius: 50%;
  -moz-border-radius: 50%;
  border-radius: 50%;
  background-color: #403e3e;
  cursor: pointer;
}
#reward .close i {
  font-size: 20px;
  color: #fff;
}
#reward .reward-p {
  color: #403e3e;
  font-weight: bold;
  font-size: 20px;
  text-align: center;
  text-shadow: 1px 1px 1px #70b6ff;
}
#reward .reward-p i {
  margin: 0 10px;
  transform: translateY(2px);
}
#reward .reward-box {
  display: flex;
  justify-content: space-between;
  width: 100%;
}
#reward .reward-box .reward-item {
  text-align: center;
  margin: 0 10px;
}
#reward .reward-type {
  font-size: 16px;
  display: block;
  color: #000;
  margin-top: 10px;
}
#reward .reward-img {
  display: block;
  width: 12rem;
  height: 12rem;
  -webkit-border-radius: 3px;
  -moz-border-radius: 3px;
  border-radius: 3px;
}
@media (max-width: 768px) {
  #reward {
    padding: 0 10px 10px;
  }
  #reward .reward-img {
    max-width: 10rem;
    max-height: 10rem;
    margin: 0 5px;
  }
}
